import React from 'react';
import styled from 'styled-components';
import Theme from 'app/assets/theme';
import { IconButton, Tooltip, Typography } from '@material-ui/core';
import { PostAdd } from '@material-ui/icons';

const ToolbarWrapper = styled.div`
	position: absolute;
	display: flex;
	justify-content: space-around;
	align-items: center;
	top: 0%;
	right: 0%;
	height: 50px;
	background-color: ${Theme.ncpWhite};
	flex-direction: row;
	border-bottom-left-radius: 5px;
	min-width: 50px;
`;

const TooltipText = styled(Typography)`
	font-size: 14px;
	margin-bottom: 0px;
`;

function PassageToolbar(props) {
	const { handleAddParagraph } = props;
	return (
		<ToolbarWrapper className="card">
			<Tooltip title={<TooltipText>Add paragraph</TooltipText>}>
				<IconButton onClick={() => handleAddParagraph()} aria-label="add paragraph">
					<PostAdd></PostAdd>
				</IconButton>
			</Tooltip>
		</ToolbarWrapper>
	);
}

export default PassageToolbar;
